Article: Voting For Ben Carson? http://prophesyagain.org/voting-for-ben-carson/

"The government under which Jesus lived was corrupt and oppressive; on every hand were crying abuses,--extortion, intolerance, and grinding cruelty. Yet the Savior attempted no civil reforms. He attacked no national abuses, nor condemned the national enemies. He did not interfere with the authority or administration of those in power. He who was our example kept aloof from earthly governments. Not because He was indifferent to the woes of men, but because the remedy did not lie in merely human and external measures. To be efficient, the cure must reach men individually, and must regenerate the heart."  {DA 509.3}  
"But today in the religious world there are multitudes who, as they believe, are working for the establishment of the kingdom of Christ as an earthly and temporal dominion. They desire to make our Lord the ruler of the kingdoms of this world, the ruler in its courts and camps, its legislative halls, its palaces and market places. They expect Him to rule through legal enactments, enforced by human authority. Since Christ is not now here in person, they themselves will undertake to act in His stead, to execute the laws of His kingdom. The establishment of such a kingdom is what the Jews desired in the days of Christ. They would have received Jesus, had He been willing to establish a temporal dominion, to enforce what they regarded as the laws of God, and to make them the expositors of His will and the agents of His authority. But He said, 'My kingdom is not of this world.' John 18:36. He would not accept the earthly throne."  {DA 509.2} 
"Christianity--how many there are who do not know what it is! It is not something put on the outside. It is a life inwrought with the life of Jesus. It means that we are wearing the robe of Christ's righteousness. In regard to the world, Christians will say, We will not dabble in politics. They will say decidedly, We are pilgrims and strangers; our citizenship is above. They will not be seen choosing company for amusement. They will say, We have ceased to be infatuated by childish things. We are strangers and pilgrims, looking for a city which hath foundations, whose builder and maker is God." {TM 131.1}
